    render() {
        return (
            <>
            < AboutStyle />
                <div className='container'>
                <div className="row main-about">
                    <div className="col-lg-6 col-mb-12 px-2">
                        <h1 >Welcome to Web Education </h1>
                    </div>
                    <div className="col-lg-6 col-mb-12 px-2">
                        <img src={Img1} alt="" className='w-100' />
                    </div>
                </div>
            </div>
            </>
        );
    }
}

export default About;
